import { CampaingName, HeaderContainer, CampaingId, TitleContainer } from './styles'

interface Props {
  idCampaing: number
  name: string
}

const HeaderCampaing = ({ idCampaing, name }: Props) => {
  return(
    <HeaderContainer>
      <TitleContainer>
        <CampaingName>{name}</CampaingName>
        <CampaingId>id campanha: {idCampaing}</CampaingId>
      </TitleContainer>
    </HeaderContainer>
  )
}

export default HeaderCampaing
